script: |
  super -f text -I q9521.spq | sort > q9521.out

inputs:
  - name: q9521.spq
    data: |
      SELECT DISTINCT + col2 * + 63 + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( col1 - + + 12 ) IS NULL AND NOT col1 * col1 + + col1 <> ( + 6 + col1 * col2 );
  - name: tab1

outputs:
  - name: q9521.out
    data: |
